import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
import Home from "./Home";
import Service from "./Service";

function App() {
  return (
    <>
      <BrowserRouter>
        <Route path="/" component={Home} />
        <About />
        <Contact />
        <Service />
      </BrowserRouter>
    </>
  );
}

export default App;
